import Navbar from 'components/Navbar';

import './styles.css';

const Home = () => {
    return (
        <>
        <Navbar/>
        <div className="home-container">
            <div className="home-content-container">
                <h1>Encontre um perfil no Github</h1>
            </div>
        </div>
        </>
    )
}

export default Home;
